import React,{useContext} from "react";
import {View,StyleSheet} from "react-native";
import {Text} from "react-native-elements";
import MapView,{Polyline} from "react-native-maps";
import {Context as LocationContext} from "../context/AuthContext";

const Map = () => {
    const {state,action} = useContext(LocationContext);
    return (
        <View>
            <MapView style={styles.map}
            initialRegion={{
                latitude:37.3323,
                longitude:-122.03121,
                latitudeDelta:0.01,
                longitudeDelta:0.02
            }}
            >
            </MapView>
        </View>
    )
}

const styles = StyleSheet.create({
     map:{
         height:300
     }
})

export default Map;
